import React from "react";
import s from "./Sidebar.module.css";
import {SidebarPropsType} from "./SidebarContainer";


type FriendType = {
    name: string
    id: number
    img: string
}
export type SidebarType = {
    friends: Array<FriendType>
}






const Sidebar = (props: SidebarPropsType) => {

    let FriendsElement = props.friends.map((p: {id: number, name: string, img: string}) => <Sidebar id={p.id} name={p.name} img={p.img} />)

    return (
        <div className={s.sidebar}>
            <div className={s.friend}>
                <img className={s.img} src={props.friends.img}/>
            <div>{props.friends.name}</div>
            </div>

        </div>
    )
}

export default Sidebar
